  true,\n\t\"url\": null,\n\t\"notes\": \"IDEA Part C State Performance Plan and Annual
  Performance Report, Fiscal Year 2005 (IDEA Part C SPP/APR FY2005), is a study that
  is part of the IDEA Part C State Performance Plan and Annual Performance Report
  program; program data is available since 2002-03 at <http://www2.ed.gov/fund/data/report/idea/partcspap/allyears.html>.
  IDEA Part C SPP/APR FY2005 (http://idea.ed.gov/part-c/search/new) is a cross-sectional
  study that collects State Performance Plans that evaluate the state lead agencyufffds
  efforts to implement the requirements and purposes of Part C of the Individuals
  with Disabilities Education Improvement Act of 2004 and describe how the lead agency
  will improve such implementation. The study also collects Annual Performance Reports
  which report annually to the public on the early intervention service program located
  in the state on the targets in the lead agencyufffds performance plan. The studyufffds
  response rate was 100 percent. Key statistics produced from IDEA Part C SPP/APR
  FY2005 are infants and toddlers participating in early intervention programs and
  effectiveness of such programs, and other performance indicators.\",\n\t\"owner_org\":
